import React from "react";

const Footer = () => {
  return (
    <div className="bg-neutral-200 text-center border-t-2 border-b-2 border-black h-10 fixed bottom-0 w-full">
      <div className="p-2 text-center text-neutral-500">{"© 2023 "}</div>
      <p className="text-black">Oleksii Odazhiu</p>
    </div>
  );
};

export default Footer;
